import React from 'react';

import { Text, Form, Button, Layout } from 'react-lifesg-design-system';
import { ThemeProvider } from "styled-components";
import styled from "styled-components";

interface Props {
    onChange: (fieldName: string, value: string) => void;
    onSave: () => void;
}

const StyledContainer = styled(Layout.GridContainer)`
    display: grid;
    grid-template-columns: 0 8fr 0;
`;

const StyledSection = styled(Layout.Section)`
    margin-top: 10%;
    min-height: 600px;
`;

const dashboard: React.FunctionComponent<Props> = (props) => {
  return (
    <StyledSection>
            <StyledContainer>
                <Layout.GridContent>
                <Text.H3>Add Appointment</Text.H3>
                

                </Layout.GridContent>

                <Button.Default
                    onClick={props.onSave}
                >Add</Button.Default>

            </StyledContainer>
        </StyledSection>

  )
}

export default dashboard;
